// frontend/src/App.tsx
import React from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";

import Home from "./pages/home";
import Login from "./pages/login";
import ProviderDashboard from "./pages/dashboards/provider";
import Admin from "./pages/dashboards/admin";
import CarePlanEditor from "./pages/participants/Care/CarePlanEditor";
import CareSetup from "./pages/participants/Care/CareSetup";
import CareSignOff from "./pages/participants/Care/CareSignOff";
import RiskAssessmentEditor from "./pages/participants/Care/RiskAssessmentEditor";

type Role = "admin" | "provider" | "coordinator" | "worker" | "finance";

// NO SECURITY: gate always passes (you asked for no auth/secret tokens)
const RequireRole: React.FC<{ children: React.ReactNode; allowed: Role[] }> = ({ children }) => <>{children}</>;

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route index element={<Navigate to="/home" replace />} />
        <Route path="/home" element={<Home />} />
        <Route path="/login" element={<Login />} />

        <Route
          path="/admin"
          element={
            <RequireRole allowed={["admin"]}>
              <Admin />
            </RequireRole>
          }
        />

        <Route
          path="/provider"
          element={
            <RequireRole allowed={["provider", "admin", "coordinator"]}>
              <ProviderDashboard />
            </RequireRole>
          }
        />

        <Route
          path="/participants/care/plan"
          element={
            <RequireRole allowed={["provider", "admin", "coordinator", "worker"]}>
              <CarePlanEditor />
            </RequireRole>
          }
        />
        <Route
          path="/participants/care/setup"
          element={
            <RequireRole allowed={["provider", "admin", "coordinator", "worker"]}>
              <CareSetup />
            </RequireRole>
          }
        />
        <Route
          path="/participants/care/signoff"
          element={
            <RequireRole allowed={["provider", "admin", "coordinator", "worker"]}>
              <CareSignOff />
            </RequireRole>
          }
        />
        <Route
          path="/participants/care/risk"
          element={
            <RequireRole allowed={["provider", "admin", "coordinator", "worker"]}>
              <RiskAssessmentEditor />
            </RequireRole>
          }
        />

        <Route path="*" element={<Navigate to="/home" replace />} />
      </Routes>
    </BrowserRouter>
  );
}
